import { NavBar, NavLink } from "./NavComponents";

const NavComponent = (props: any) => {

  let navHeight = document.getElementById("landingPage")?.offsetHeight;

  const navToggle = () => {

    if(navHeight && navHeight < window.scrollY  ) {
      return true;
    } else {
      return false;
    };
  };

  return (
    <NavBar navBackground={navToggle}>
      <NavLink
        to="landingPage"
        spy={true}
        smooth={true}
        duration={400}
      >
        Home
      </NavLink>
      <NavLink
        to="main"
        spy={true}
        smooth={true}
        duration={400}
      >
        About
      </NavLink>
      {/* <li>
        Work
      </li> */}
      <NavLink
        to="contact-form"
        spy={true}
        smooth={true}
        duration={400}
      >
        Contact
      </NavLink>
    </NavBar>
  );
};

export default NavComponent;
